import React, { useState, useEffect } from "react";
import axios from "axios";
import { ArrowDown, ArrowUp } from "../../common/icons/icons";
import { Link, NavLink } from "react-router-dom";
import { useSelector } from "react-redux";

const ContractEmployeeMain = () => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    getUsers();
  }, []);

  const getUsers = async () => {
    const response = await axios.get("http://localhost:5000/users");
    setUsers(response.data);
  };

  return (
    <div>
      {users.length > 0 ? (
        <div className="div-table">
          <div className="div-table-options">
            <NavLink className="table-options" to="/adduser">
              Dodaj u≈ºytkownika
            </NavLink>
          </div>
          <table className="employee-table">
            <thead>
              <tr className="employee-tr">
                <th>Stanowisko</th>
                <th>Start Kontraktu</th>
                <th>Koniec Kontraktu</th>
                <th>Rodzaj Kontraktu</th>
                <th className="employee-setting">Opcje</th>
              </tr>
            </thead>
            <tbody>
            {user.profile.contracts.map((contract) => (
                <React.Fragment key={user.uuid}>
                  <tr className="employee-tr">
                    <td className="td-employee">
                      {user.profile && user.profile.contracts[0] ? (
                        user.profile.contracts[0].position
                      ) : (
                        "Brak danych"
                      )}
                    </td>
                    <td className="td-employee">
                      {user.profile && user.profile.contracts[0] ? (
                        user.profile.contracts[0].startContract
                      ) : (
                        "Brak danych"
                      )}
                    </td>
                    <td className="td-employee">
                      {user.profile && user.profile.contracts[0] ? (
                        user.profile.contracts[0].endContract
                      ) : (
                        "Brak danych"
                      )}
                    </td>
                    <td className="td-employee">
                      {user.profile && user.profile.contracts[0] ? (
                        user.profile.contracts[0].typeContract
                      ) : (
                        "Brak danych"
                      )}
                    </td>
                    <td className="td-employee employee-setting">
                      <Link
                        to={`/users/${user.id}`}
                        className="button is-small is-info"
                      >
                        Kontrakty
                      </Link>
                    </td>
                  </tr>
                  {user.profile && user.profile.contracts.length > 1 && (
                    <tr className="employee-tr-info">
                      <td colSpan="5">
                        {user.profile.contracts.map((contract) => (
                          <div key={contract.id}>
                            <div>Stanowisko: {contract.position}</div>
                            <div>Start Kontraktu: {contract.startContract}</div>
                            <div>Koniec Kontraktu: {contract.endContract}</div>
                            <div>Rodzaj Kontraktu: {contract.typeContract}</div>
                            <hr />
                          </div>
                        ))}
                      </td>
                    </tr>
                  )}
                </React.Fragment>
              ))}
            </tbody>
          </table>
        </div>
      ) : (
        <div>Loading...</div>
      )}
    </div>
  );
};

export default ContractEmployeeMain;
